import Link from 'next/link';

export default function PostList({ posts }) {
    if (posts === 'undefined') return null;

    return (
        <div>
            {!posts && <div>No posts!</div>}
            <ul>
            {posts &&
                posts.map((post) => {
                return (
                    <li key={post.slug}>
                    <Link href={{ pathname: `/blog/${post.slug}` }}>
                        <a>{post.frontmatter.title}</a>
                    </Link>
                    </li>
                )
                })}
            </ul>
        </div>
    )
}
